import logo from './logo.svg';
import './App.css';
import Login from './Login';
import {BrowserRounter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRounter>
      <Routes>
        <Route path='/' element={<Login />}></Route>
      </Routes>
      <Login />
    </BrowserRounter>


  );
}

export default App;
